		(SELECT POSITION_ID
		 FROM NFL_POSITION
		 WHERE POSITION_ABBR = "WR"),
		(SELECT CONTRACT_ID
		 FROM NFL_CONTRACT
		 WHERE TEAM_ID = 
			(SELECT TEAM_ID
			 FROM NFL_TEAM
			 WHERE TEAM_NAME = "Bears")
		 AND PERSON_ID =  
			(SELECT PERSON_ID
			 FROM NFL_PERSON
			 WHERE PERSON_FIRST_NAME = "earl"
				AND PERSON_HEIGHT = 72
				AND PERSON_WEIGHT = 206
				AND PERSON_LAST_NAME = "bennett")));

